import { useParams } from "react-router-dom";
import useFetch from "./useFetch";

const BlogDetails = () => {
  let { id } = useParams();
  const { data, err } = useFetch(" http://localhost:8000/blogs");
  return (
    <div className="blog-details">
      <h2>BlogDetails - {id}</h2>
       {data.filter((blog)=>{
           blog.id != id})}
    </div>
  );
};

export default BlogDetails;
